export default function Practice() {
  return (
    <div className='container' style={{ display: 'flex', gap: '20px', justifyContent: 'center', alignItems: 'center'}}>
        <div style={{ background: 'grey', width: '30px', height: '30px', borderRadius: '100px', textAlign: 'center'}}>-</div>
        <div style={{ background: 'white', width: '100px'}}>0</div>
        <div style={{ background: 'grey', width: '30px' }}>+</div>
    </div>
  );
};
